import React from 'react';

const container = {
    backgroundColor:'#000',
    color:'white',
}

const text = {
    textAlign: 'center',
    fontSize: '36px'
}

const Footer = () => {
    return (
        <div>
            <footer style={container} className="w3-container w3-padding-32 w3-margin-top">
                <p style={text}>Copyright 2022 Bishkek</p>
            </footer>
        </div>
    );
};

export default Footer;

